import Head from 'next/head';

import styled from 'styled-components';
import Background from '../components/UI/Background';

import ReactNipple from 'react-nipple';

const Joystick1 = () => {
  const handleEvent = (evt, data) => {
    // console.log(evt.target.box);
    console.log(data.in);
  };

  return (
    <>
      <Background color="#313131" />
      <Head>
        <title>Game Lobby</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <div style={{ position: 'fixed', bottom: 100, left: 100 }}>
        <ReactNipple
          // supports all nipplejs options
          // see https://github.com/yoannmoinet/nipplejs#options
          options={{ mode: 'static', position: { top: '50%', left: '50%' } }}
          // any unknown props will be passed to the container element, e.g. 'title', 'style' etc

          // all events supported by nipplejs are available as callbacks
          // see https://github.com/yoannmoinet/nipplejs#start
          onMove={(evt, data) => console.log(evt, data)}
          onStart={handleEvent}
          onEnd={handleEvent}
          onMove={handleEvent}
          onDir={handleEvent}
          onPlain={handleEvent}
          onShown={handleEvent}
          onHidden={handleEvent}
          onPressure={handleEvent}
        />
      </div>
      <div style={{ position: 'fixed', bottom: 100, right: 100 }}>
        <ReactNipple
          options={{ mode: 'static', position: { top: '50%', left: '50%' } }}
          onMove={(evt, data) => console.log(evt, data)}
          onMove={handleEvent}
        />
      </div>
    </>
  );
};

export default Joystick1;
